%primary-btn{
    display: flex;
    justify-content: center;
    align-items: center;
    flex-flow: wrap;
    cursor: pointer;
    outline: none;
    background-color: $primary-color;
    color: $primary-text;
    font-size: 1.5rem;
    padding: .5rem 3rem;
    border: none;
    border-radius: 1rem;
}

%primary-btn-hover{
    background-color: $secondery-hover;
}

%secondery-btn{
  display: flex;
  justify-content: center;
  align-items: center;
  flex-flow: wrap;
  cursor: pointer;
  outline: none;
  background-color: $primary-color;
  color: $primary-text;
  font-size: 1.5rem;
  padding: .5rem 3rem;
  border: none;
  border-radius: 1rem;
}

%secondery-btn-hover{
  // background-color: 
}

